function Movie(movies) {

    return (
        <div> 
        {movies.map((movie) => (
          <div key={movie.id}>
            <h2>{movie.title}</h2>
            <img src={movie.medium_cover_image} alt={movie.title}></img>
            <p>{movie.summary}</p>
            <ul>
            {movie.genres.map((g) => (
              <li key={g}>{g}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    )
}

export default Movie;
